](#analyze-guiding)\n","    * [Key tasks](#analyze-key)\n","    * [Deliverable](#analyze-deliverable)\n","* [Share](#share)\n","    * [Guiding questions](#share-guiding)\n","    * [Key tasks](#share-key)\n","    * [Deliverable](#share-deliverable)\n","* [Act](#act)\n","    * [Guiding questions](#act-guiding)\n","    * [Key tasks](#act-key)\n","    * [Deliverable](#act-deliverable)\n","* [Conclusion](#act-Conclusion)"]},{"cell_type":"markdown","id":"4d77fe82","metadata":{"papermill":{"duration":0.018851,"end_time":"2023-05-24T18:35:57.708986","exception":false,"start_time":"2023-05-24T18:35:57.690135","status":"completed"},"tags":[]},"source":["\n","<a id=\"Introduction\"></a>\n","# Introduction\n","\n","This is the detailed breakdown of Case Study 1 for Google Data Analytics'Capstone Project. Source for random sampling Check(https://www.calculator.net/sample-size-calculator.html). \n","* This random sampling was performed on 202106-divy-tripdata.csv file. \n","* _From the preliminary analysis, I have concluded that Casuals have a higher usage during weekends while the Members have surge during Weekdays. This probably indicates that casuals are using it for leisure or recreation while members are using it as commutes_*\n","\n","For this project the below mentioned steps will be followed to ensure its completion:\n","* I have explained the learning from the following perspective that was taught to us: Ask, Prepare, Process, Analyze, Share, and Act.\n","* The report has the following deliverables as desired by the roadmap guidelines:\n","\n","    * _Clear statement of the business task_\n","    * _Description of all data sources used_\n","    * _Documentation of any cleaning or manipulation of data_\n","    * _Summary of the analysis_\n","    * _Supporting visualizations and key findings_\n","    * _My top three recommendations based on your analysis_"]},{"cell_type":"markdown","id":"ef2df4e4","metadata":{"papermill":{"duration":0.01834,"end_time":"2023-05-24T18:35:57.745679","exception":false,"start_time":"2023-05-24T18:35:57.727339","status":"completed"},"tags":[]},"source":["<a id=\"ask\"></a>\n","# Ask\n","---\n","The Ask phase usually requires us to do the following things:\n","* Ask effective questions\n","* Define the problem\n","* Use structured thinking\n","* Communicate with others, the scenario below entails the functions that have been described before hand:\n","\n"," * Scenario\n","    ---\n","    You are a junior data analyst working in the marketing analyst team at Cyclistic, a bike-share company in Chicago. The director of marketing believes the company’s future success depends on maximizing the number of annual memberships. Therefore, your team wants to understand how casual riders and annual members use Cyclistic bikes dierently. From these insights, your team will design a new marketing strategy to convert casual riders into annual members. But first, Cyclistic executives must approve your recommendations, so they must be backed up with compelling data insights and professional data visualizations.\n","    \n","  * Characters and teams\n","    ---\n","    Cyclistic: A bike-share program that features more than 5,800 bicycles and 600 docking stations. Cyclistic sets itself apart by also oering reclining bikes, hand tricycles, and cargo bikes, making bike-share more inclusive to people with disabilities and riders who can’t use a standard two-wheeled bike. The majority of riders opt for traditional bikes; about 8% of riders use the assistive options. Cyclistic users are more likely to ride for leisure, but about 30% use them to commute to work each day.\n","   \n","   Lily Moreno: The director of marketing and your manager. Moreno is responsible for the development of campaigns and initiatives to promote the bike-share program. These may include email, social media, and other channels.\n","   \n","   Cyclistic marketing analytics team: A team of data analysts who are responsible for collecting, analyzing, and reporting data that helps guide Cyclistic marketing strategy. You joined this team six months ago and have been busy learning about Cyclistic’s mission and business goals — as well as how you, as a junior data analyst, can help Cyclistic achieve them.\n","    \n","    Cyclistic executive team: The notoriously detail-oriented executive team will decide whether to approve the recommended marketing program.\n","## Three questions will guide the future marketing program:\n"," \n","* **How do annual members and casual riders use Cyclistic bikes differently?**\n","\n","* **Why would casual riders buy Cyclistic annual memberships?**\n","\n","* **How can Cyclistic use digital media to influence casual riders to become members?**\n"]},{"cell_type":"markdown","id":"b2664950","metadata":{"papermill":{"duration":0.018391,"end_time":"2023-05-24T18:35:57.782429","exception":false,"start_time":"2023-05-24T18:35:57.764038","status":"completed"},"tags":[]},"source":["<a id=\"ask-guiding\"></a>\n","## Guiding questions\n","\n","* **What is the problem you are trying to solve?**\n","    \n","* **How can your insights drive business decisions?**\n","\n","* **How should you organize your data to perform analysis on it??**\n","\n","* **Has your data been properly formatted?**\n","\n","* **What surprises did you discover in the data?**\n","\n","* **What trends or relationships did you find in the data?**\n","\n","* **How will these insights help answer your business questions?**\n"]},{"cell_type":"markdown","id":"7b2b4c45","metadata":{"papermill":{"duration":0.018472,"end_time":"2023-05-24T18:35:57.819768","exception":false,"start_time":"2023-05-24T18:35:57.801296","status":"completed"},"tags":[]},"source":["<a id=\"ask-key\"></a>\n","## Key tasks\n","\n","- [x] Identify the business task\n","- [x] Consider key stakeholders"]},{"cell_type":"markdown","id":"b9d24094","metadata":{"papermill":{"duration":0.018428,"end_time":"2023-05-24T18:35:57.85656","exception":false,"start_time":"2023-05-24T18:35:57.838132","status":"completed"},"tags":[]},"source":["<a id=\"ask-deliverable\"></a>\n","## Deliverable\n","\n","- [x] A clear statement of the business task\n","    \n","    This pertains to finding the difference between casuals and members and what digital media can be used to target them."]},{"cell_type":"markdown","id":"4f929f0e","metadata":{"papermill":{"duration":0.018365,"end_time":"2023-05-24T18:35:57.893154","exception":false,"start_time":"2023-05-24T18:35:57.874789","status":"completed"},"tags":[]},"source":["<a id=\"prepare\"></a>\n","# Prepare\n","Cyclistic’s historical trip data has been used to analyze and identify trends. \n","Download the previous 12 months of Cyclistic trip data here. (Note: The datasets have a different name because Cyclistic is a fictional company. For the purposes of this case study, the datasets are appropriate and will enable you to answer the business questions. The data has been made available by Motivate International Inc. under this license.) This is public data that you can use to explore how different customer types are using Cyclistic bikes. But note that data-privacy issues prohibit you from using riders’ personally identifiable information. This means that you won’t be able to connect pass purchases to credit card numbers to determine if casual riders live in the Cyclistic service area or if they have purchased multiple single passes.\n","Now, prepare your data for analysis using the following Case Study Roadmap as a guide:\n","The link to the dataset has been listed here: [this kaggle dataset](https://www.kaggle.com/timgid/cyclistic-dataset-google-certificate-capstone)."]},{"cell_type":"markdown","id":"f91ef712","metadata":{"papermill":{"duration":0.018304,"end_time":"2023-05-24T18:35:57.929616","exception":false,"start_time":"2023-05-24T18:35:57.911312","status":"completed"},"tags":[]},"source":[" <a id=\"prepare-key\"></a>\n"," ## Key tasks\n","\n","- [x] Download data and store it appropriately.\n","- [x] Identify how it’s organized.\n","- [x] Sort and filter the data.\n","- [x] Determine the credibility of the data."]},{"cell_type":"markdown","id":"8050accc","metadata":{"papermill":{"duration":0.018307,"end_time":"2023-05-24T18:35:57.966185","exception":false,"start_time":"2023-05-24T18:35:57.947878","status":"completed"},"tags":[]},"source":["<a id=\"prepare-deliverable\"></a>\n","## Deliverable\n","\n","- [x] A description of all data sources used\n","\n","The data source is the riding data that has been provided by the Cyclistic Company."]},{"cell_type":"markdown","id":"39a45cfa","metadata":{"papermill":{"duration":0.018418,"end_time":"2023-05-24T18:35:58.002867","exception":false,"start_time":"2023-05-24T18:35:57.984449","status":"completed"},"tags":[]},"source":["<a id=\"prepare-guiding\"></a>\n","## Guiding questions\n","\n","* **Where is your data located?**\n","\n","This is a kaggle dataset.\n","\n","* **How is the data organized?**\n","\n","Organised by month, separate csv files.\n","\n","* **Are there issues with bias or credibility in this data? Does your data ROCCC?**\n","\n","This is a fictitious company and the underlying assumption is that the recorded data holds the basic standards of integrity.For the sake of clarity, we will specify, that the data is ROCCC, which is google's method of saying that it is reliable, original, comprehensive, current and cited.\n","\n","* **How are you addressing licensing, privacy, security, and accessibility?**\n","\n","We are aware that the company has  their own licence on the dataset. The data does not have any revealing personal information of the users, thus ensuring no breach of privacy.\n","\n","* **How did you verify the data’s integrity?**\n","\n","The files post clean up have consistent number of columns and an easy pattern was established\n","\n","* **How does it help you answer your question?**\n","\n","The data seems to have some insights on casual and member type riders, upon further inspection the same can be confirmed or rejected\n","\n","* **Are there any problems with the data?**\n","\n","Detailed information on casual riders and the pitstops could have revealed a detailed profile of consumers and customer segments could also be plotted. "]},{"cell_type":"markdown","id":"8a032c3b","metadata":{"papermill":{"duration":0.018346,"end_time":"2023-05-24T18:35:58.039866","exception":false,"start_time":"2023-05-24T18:35:58.02152","status":"completed"},"tags":[]},"source":["<a id=\"process\"></a>\n","# Process\n","\n","This step will prepare the data for analysis. All the csv files will be merged into one file to improve workflow"]},{"cell_type":"markdown","id":"33fdb975","metadata":{"papermill":{"duration":0.018336,"end_time":"2023-05-24T18:35:58.076607","exception":false,"start_time":"2023-05-24T18:35:58.058271","status":"completed"},"tags":[]},"source":["<a id=\"process-code\"></a>\n","## Code\n","This involves reading libraries and reading the dataset."]},{"cell_type":"markdown","id":"597524d4","metadata":{"papermill":{"duration":0.018504,"end_time":"2023-05-24T18:35:58.113865","exception":false,"start_time":"2023-05-24T18:35:58.095361","status":"completed"},"tags":[]},"source":["<a id=\"process-code-dependences\"></a>\n","### Dependences\n","\n","The main dependencie for the project will be tidyverse."]},{"cell_type":"code","execution_count":1,"id":"e4d300ae","metadata":{"execution":{"iopub.execute_input":"2023-05-24T18:35:58.154939Z","iopub.status.busy":"2023-05-24T18:35:58.152754Z","iopub.status.idle":"2023-05-24T18:36:00.326658Z","shell.execute_reply":"2023-05-24T18:36:00.324533Z"},"papermill":{"duration":2.197703,"end_time":"2023-05-24T18:36:00.329795","exception":false,"start_time":"2023-05-24T18:35:58.132092","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["── \u001b[1mAttaching packages\u001b[22m ─────────────────────────────────────── tidyverse 1.3.2 ──\n","\u001b[32m✔\u001b[39m \u001b[34mggplot2\u001b[39m 3.3.6    