om = 12, maptype = \"terrain\")\n","\n","# Plot for casual riders\n","ggmap(chicago_map, darken = c(0.2, \"white\")) +\n","  geom_point(data = casual_riders, mapping = aes(x = start_lng, y = start_lat, color = rideable_type), size = 4) +\n","  coord_fixed(0.8) +\n","  labs(title = \"Most used routes by Casual riders\", x = NULL, y = NULL) +\n","  theme(legend.position = \"none\")\n","\n","# Plot for member riders\n","ggmap(chicago_map, darken = c(0.2, \"white\")) +\n","  geom_point(data = member_riders, mapping = aes(x = start_lng, y = start_lat, color = rideable_type), size = 4) +  \n","  coord_fixed(0.8) +\n","  labs(title = \"Most used routes by Member riders\", x = NULL, y = NULL) +\n","  theme(legend.position = \"none\")\n"]},{"cell_type":"code","execution_count":10,"id":"dd4d63a7","metadata":{"execution":{"iopub.execute_input":"2023-05-24T18:43:17.712499Z","iopub.status.busy":"2023-05-24T18:43:17.710447Z","iopub.status.idle":"2023-05-24T18:51:14.743143Z","shell.execute_reply":"2023-05-24T18:51:14.740599Z"},"papermill":{"duration":477.180312,"end_time":"2023-05-24T18:51:14.833657","exception":false,"start_time":"2023-05-24T18:43:17.653345","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["Downloading GitHub repo dkahle/ggmap@tidyup\n","\n"]},{"name":"stdout","output_type":"stream","text":["vctrs       (0.4.1  -> 0.6.2 ) [CRAN]\n","stringi     (1.7.8  -> 1.7.12) [CRAN]\n","rlang       (1.0.5  -> 1.1.1 ) [CRAN]\n","lifecycle   (1.0.2  -> 1.0.3 ) [CRAN]\n","cli         (3.4.0  -> 3.6.1 ) [CRAN]\n","utf8        (1.2.2  -> 1.2.3 ) [CRAN]\n","fansi       (1.0.3  -> 1.0.4 ) [CRAN]\n","tidyselect  (1.1.2  -> 1.2.0 ) [CRAN]\n","tibble      (3.1.8  -> 3.2.1 ) [CRAN]\n","pillar      (1.8.1  -> 1.9.0 ) [CRAN]\n","sys         (3.4    -> 3.4.2 ) [CRAN]\n","colorspace  (2.0-3  -> 2.1-0 ) [CRAN]\n","viridisLite (0.4.1  -> 0.4.2 ) [CRAN]\n","cpp11       (0.4.2  -> 0.4.3 ) [CRAN]\n","stringr     (1.4.1  -> 1.5.0 ) [CRAN]\n","purrr      