nalysis reveals that temperature plays a significant role in ride volume. As temperatures increase, there is a corresponding rise in the number of rides. This suggests that ridership is influenced by weather conditions, with more favorable temperatures attracting a larger volume of riders.\n","\n","    Weekend Peaks: The dataset shows a higher volume of rides on weekends compared to weekdays. This finding implies that the bikes are predominantly utilized for recreational purposes during weekends, potentially for leisure activities or outings.\n","\n","    Time of Day: The analysis indicates a notable increase in bike ridership during the afternoon hours. This trend suggests that the bikes are more frequently used during the later part of the day, aligning with leisure and outdoor activities.\n","\n","In summary, the dataset reflects a higher proportion of members compared to casual riders, with members potentially utilizing the bikes for regular activities such as commuting to work. Additionally, weekends exhibit increased bike usage, likely for recreational purposes. Temperature is a significant factor influencing ride volume, with higher temperatures leading to more rides. The findings collectively suggest that the bikes serve both utilitarian and leisure purposes for different rider segments."]},{"cell_type":"markdown","id":"1f154d85","metadata":{"papermill":{"duration":0.076548,"end_time":"2023-05-24T18:55:43.232251","exception":false,"start_time":"2023-05-24T18:55:43.155703","status":"completed"},"tags":[]},"source":["<a id=\"share-guiding\"></a>\n","## Guiding questions\n","\n","* **Were you able to answer the question of how annual members and casual riders use Cyclistic bikes differently?**\n","\n","Yes. The data points to several differences between casuals and members.\n","\n","* **What story does your data tell?**\n","\n","The main story the data tells is that members have set schedules, as seen on chart 06 on key timestamps. Those timestamps point out that members use the bikes for routine activities, like going to work. Charts like 08 also point out that they have less riding time, because they have a set route to take.\n","\n","* **How do your findings relate to your original question?**\n","\n","The findings build a profile for members, relating to \"*Find the keys differences between casuals and annual riders*\", also knowing whey they use the bikes helps to find \"*How digital media could influence them*\".\n","\n","* **Who is your audience? What is the best way to communicate with them?**\n","\n","The main target audience is my cyclistic marketing analytics team and Lily Moreno. The best way to communicate is through a slide presentation of the findings.\n","\n","* **Can data visualization help you share your findings?**\n","\n","Yes, the main core of the finds is through data visualization.\n","\n","* **Is your presentation accessible to your audience?**\n","\n","Yes, the plots were made using vibrant colors, and corresponding labels."]},{"cell_type":"markdown","id":"5b3f0f58","metadata":{"papermill":{"duration":0.074891,"end_time":"2023-05-24T18:55:43.382693","exception":false,"start_time":"2023-05-24T18:55:43.307802","status":"completed"},"tags":[]},"source":[]},{"cell_type":"markdown","id":"83bbd6ef","metadata":{"papermill":{"duration":0.074023,"end_time":"2023-05-24T18:55:43.532999","exception":false,"start_time":"2023-05-24T18:55:43.458976","status":"completed"},"tags":[]},"source":["Deliverable\n","\n","    Supporting visualizations and key findings\n"]},{"cell_type":"markdown","id":"11d34bd1","metadata":{"papermill":{"duration":0.074005,"end_time":"2023-05-24T18:55:43.679647","exception":false,"start_time":"2023-05-24T18:55:43.605642","status":"completed"},"tags":[]},"source":["<a id=\"act\"></a>\n","# Act\n","\n","The act phase would be done by the marketing team of the company. The main takeaway will be the top three recommendations for the marketing."]},{"cell_type":"markdown","id":"469940f2","metadata":{"papermill":{"duration":0.074293,"end_time":"2023-05-24T18:55:43.828156","exception":false,"start_time":"2023-05-24T18:55:43.753863","status":"completed"},"tags":[]},"source":["<a id=\"act-guiding\"></a>\n","## Guiding questions\n","\n","* **What is your final conclusion based on your analysis?**\n","\n","Members and casual have different habits when using the bikes. The conclusion is further stated on the share phase.\n","\n","* **How could your team and business apply your insights?**\n","\n","The insights could be implemented when preparing a marketing campaign for turning casual into members. The marketing can have a focus on workers as a green way to get to work.\n","\n","* **What next steps would you or your stakeholders take based on your findings?**\n","\n","Further analysis could be done to improve the findings, besides that, the marketing team can take the main information to build a marketing campaign.\n","\n","* **Is there additional data you could use to expand on your findings?**\n","    * Mobility data.\n","    * Improved climate data.\n","    * More information members."]},{"cell_type":"markdown","id":"4c6e7c40","metadata":{"papermill":{"duration":0.075106,"end_time":"2023-05-24T18:55:43.975856","exception":false,"start_time":"2023-05-24T18:55:43.90075","status":"completed"},"tags":[]},"source":["<a id=\"act-key\"></a>\n","## Key tasks\n","\n","- [x] Create your portfolio.\n","- [x] Add your case study.\n","- [x] Practice presenting your case study to a friend or family member."]},{"cell_type":"markdown","id":"46ba0de1","metadata":{"papermill":{"duration":0.073968,"end_time":"2023-05-24T18:55:44.125764","exception":false,"start_time":"2023-05-24T18:55:44.051796","status":"completed"},"tags":[]},"source":["<a id=\"act-deliverable\"></a>\n","## Deliverable\n","\n","* Your top three recommendations based on your analysis\n","1. Build a marketing campaign focusing on show how bikes help people to get to work, while maintaining the planet green and avoid traffic. The ads could be show on  professional social networks.\n","2. Increase benefits for riding during cold months. Coupons and discounts could be handed out.\n","3. As the bikes are also used for recreations on the weekends, ads campaigns could also be made showing people using the bikes for exercise during the weeks. The ads could focus on how practical and **consistent** the bikes can be."]},{"cell_type":"markdown","id":"64ab3206","metadata":{"papermill":{"duration":0.07788,"end_time":"2023-05-24T18:55:44.28063","exception":false,"start_time":"2023-05-24T18:55:44.20275","status":"completed"},"tags":[]},"source":["<a id=\"act-Conclusion\"></a>\n","## Conclusion\n"]},{"cell_type":"markdown","id":"4b68e73e","metadata":{"papermill":{"duration":0.079985,"end_time":"2023-05-24T18:55:44.437121","exception":false,"start_time":"2023-05-24T18:55:44.357136","status":"completed"},"tags":[]},"source":["* In conclusion, the analysis of the dataset reveals compelling insights about the bike-sharing service. \n","\n","Members dominate the ridership, indicating a strong sense of loyalty and routine usage, particularly during morning and evening commuting hours. Casual riders, on the other hand, contribute to weekend rides, suggesting a preference for recreational activities. Temperature and seasonal variations impact ridership, with higher temperatures and peak summer months attracting more riders. These findings highlight the need to cater to different user behaviors and preferences, optimize bike availability during peak times, and leverage the service's popularity for both commuting and leisure purposes. By understanding these patterns, the bike-sharing service can enhance user experiences, tailor marketing strategies, and further promote sustainable transportation alternatives."]}],"metadata":{"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_l